import React from 'react';

const DarkModeToggle = ({ darkMode, toggleDarkMode }) => {
  return (
    <li className="nav-item">
      <a
        className={`nav-link ${darkMode ? 'text-light' : ''}`} onClick={toggleDarkMode} href="#"
      >
        Toggle Dark Mode
      </a>
    </li>
  );
};

export default DarkModeToggle;
